import logo from './logo.svg';
import './App.css';
import Chart from './components/chart/Chart';

function App() {
  return (
    <div className="App">
      <Chart 
        language="PT"
        title="TÁ COM DÚVIDA NO TAMANHO?"
        sub="RELAXA QUE A GENTE TE AJUDA!"
        button="CLICK ME"
      />
      <Chart 
        language="EN"
        title="NOT SURE ABOUT THE SIZE?"
        sub="NO WORRIES, WE'LL HELP YOU!"
        button="CLICK ME"
      />
    </div>
  );
}

export default App;
